(22, 486, 'Live at the bird!', NULL, 0, '21-06-2222484929conn_events.jpeg', '21-06-2222790450conn_events.jpeg', '21-06-222299532conn_events.jpeg', '21-06-2222660384conn_events.jpeg', '21-06-2222676683conn_events.jpeg', '21-06-2222531104conn_events.jpeg', '21-06-22312987conn_events_vid.mp4', '21-06-22728128conn_events_vid.mp4', '21-06-22452887conn_events_vid.mp4', 2, 'Paid', 19, 2, '2022-07-01', '22:00:00', '2022-07-02', '03:00:00', 'What does ConnEvents do?\n\nConnEvents connects users with users, users with the best events, and events with events.\n\nConnEvents is the place that is strictly designed to connect every End Users to End Users, End Users to events, and events to events.\n\nHere, users are connected before, during, and after the events. ConnEvents enhances the interaction between end-users, organizers, and the application. \n\nDiscover local and distant events based on your location without searching them. \n\nFind what\'s in the nearby area where the events are taking place. Business types include but are not limited to:\nRestaurants\nCoffee \nJuice Bar\nParking\nHotels\nBarbershops\nMuseums and Art Galleries \nHistorical/Heritage Attractions \nWildlife Attractions \nHiking\nParks/Entertainment Parks\nBars\nLive Venues\nNightclubs \nGames etc.\nUsers on the ConnEvents app can like, comment, interact, share stories (Peeks), and send direct messages inside the application. \n\nConnEvents provides a complete social media interaction vibe for all users to stay connected through events. \n\nWhat can you do and get on ConnEvents:\n\nDiscover nearby or distant events based on your location without any search.\nMinimize time and trouble to find desired events.\nAll users are connected in one place.\nShare Peeks (stories from events) taken inside the event with others.\nTake pictures and short videos inside the app while at the event.\nReceive a complete in-app event catalog of all the pictures and videos you and others took inside the app.\nLive streaming for hosts to interact with their followers to answer any questions, cancel events, or set expectations for events. \nBuy tickets easily straight from the app.\nYou can store your debit or credit cards for faster and more secured transactions.\nYou can use other options of payments for a quicker checkout (Google Pay, Apple Pay).\nNo phone, no worries. No need to print a ticket if your phone is not with you.\nCheck-in with the app scanner (with phone) or by using your Username or Ticket Code (without phone).\nFind events by city, date, and interest categories, or by a simple search.\nShare events with friends and other users. \nCheck the hosts\' portfolio (images and videos) to see their previous hosted events. \nShare events from other platforms on ConnEvents only for interaction between users.\nConnEvents provides a community where all types of event lovers can interact IN ONE PLACE and purchase tickets for their most desired events.', '5', '5', 0, NULL, '', '', '', '', '2022-06-21', '12:00:00', '2022-07-02', '00:00:00', 4, 'https://', '2022-06-21 21:39:50', 'Active'),
